import React, {Component} from 'react';
import Competencia from './Competencia';
import './Competencias.css'

class Competencias extends Component{
    constructor(props){
        super(props);
        this.state = {
            competencias: props.items
        }
    }

    render(){
        return(
            <div className="list-competencias">
                {this.state.competencias.map(
                        (key, value) => {
                            return (<Competencia key={key} nome={value.nomeCompetencia} img={value.imgCompetencia} descricao={value.descricaoCompetencia} />);
                        }
                    )
                }
            </div>
        );
    }
}

export default Competencias;
